window.bookSummaryJSON = "<p>War isn't coming. It's already being waged.</p> <p>While the universe was still young, vambraces were forged, giving their users extraordinary abilities. A brutal war was won through the blood and sacrifice of patriots. Soon, the vambraces faded to legend.</p> <p>A secret task force. A wormhole portal discovered...</p> <p>Now, Frank and Marine Space Corps-1 find themselves across the galaxy, where an ancient evil is growing. From exploratory crew to the front of enemy lines, Frank will have to decide whether to play the part of hero or to be the Marine needed to win the war.</p> <p>Because the victor takes the universe.</p> <p>The vambraces will be found again. A new order of knights will be chosen. And once again light will do battle with darkness.</p> <p>Includes a special bonus note from the authors.</p>"; 
